import React from "react";
import "./NavBar.css";

const NavBar = () => {
  return (
    <div className="navbar-wrapper">
      <ul>
        <li>Home</li>
        <li>Shop</li>
        <li>Cart</li>
      </ul>
    </div>
  );
};

export default NavBar;
